import React from "react";
import { useLocation } from 'react-router-dom';

function Home() {
    const { state } = useLocation();
    const username = state && state.username ? state.username : null;

    return (
        <div>
            <h1>Welcome, {username || 'Guest'}!</h1>
            {/* Other content */}
        </div>
    );
}

export default Home;
